Do we have plans to merge this patch recently? If so, I will solve `Merge Conflict`.

If possible you should have only one of each sections. Having public: private: then public: is a bit confusing. In this case it would be more common to do it like this:

private:
  // Types that are necessary for compilation

public:
  // as usual
private:
  // as usual

nit:

It seems strange that this parser holds reference to req even after parsing is finished.

Also it would be more object oriented if there was parse method that returns error code by value:

For example instead:
std::error_code ec;
MultipartParser parser(req, ec);

You could do:
MultipartParser parser;
std::error_code ec = parse.parse(req);

This doesn't seem to be simple fallthrough, one could think that changing state doesn't matter because you are doing fallthrough. But on a second look it matters because next iteration may start from different state.

I would like to see [[fallthrough]] replaced with break;

Someone could assume that this line could be deleted, because there is fallthrough and it would be true if this switch wasn't executed in loop, which may be hard to see because this switch has more than 100 lines of code.
